SELECT id FROM empleados
WHERE id NOT IN (SELECT empleado_id FROM empleados_sst WHERE empleado_id IS NOT NULL);

-- -------------------------------------------------------
-- 3. TABLA empleados_talento_humano (fila vinculada)
